from typing import List
import random
import sys
sys.setrecursionlimit(10000000)
# Definition for a binary tree node.
class Solution:
    def findKthLargest(self, nums: List[int], k: int) -> int:
        def partition(left,right,pivotIndex):
            pivot=nums[pivotIndex]
            nums[pivotIndex],nums[right]=nums[right],nums[pivotIndex]
            startindex=left
            for rightindex in range(left,right):
                if nums[rightindex]>=pivot:
                    nums[startindex],nums[rightindex]=nums[rightindex],nums[startindex]
                    startindex+=1
            nums[startindex],nums[right]=nums[right],nums[startindex]
            return startindex
        def quickselect(left,right,kth):
            if left==right:
                return
            pivotIndex=random.randint(left,right)
            pivotIndex=partition(left,right,pivotIndex)
            if kth==pivotIndex:
                return
            elif kth<pivotIndex:
                quickselect(left,pivotIndex-1,kth)
            else:
                quickselect(pivotIndex+1,right,kth)
        random.shuffle(nums)
        quickselect(0,len(nums)-1,k-1)
        return nums[k-1]
        

        
    
